import React from 'react'



const Nation = (props) => (
        <div>
            Test
        </div>
);

Nation.getInitialProps = async function() {
    const res = await fetch('https://api.coindesk.com/v1/bpi/currentprice.json');
    const data = await res.json();
  
    return {
      bpi: data.bpi
    };
  }
  

export default Nation;
